import React from 'react';

const About = () => {
    return (
        <div className="container"><blockquote>
            <p className="font-weight-bold">Yayas Island Mart is a minority owned business. 
            We are a black owned business that strives to bring 
            a taste of Caribbean with our products to our consumers.
            Whomever you are, we are thankful for you taking the time 
            to support our small business.</p></blockquote>
        </div>
    )
}
export default About;
